import React from 'react';
{}
const SuccessMessage = ({ message }) => {
  return (
    <div style={{ backgroundColor: 'green', color: 'white', padding: '10px', margin: '10px 0', borderRadius: '5px' }}>
      {message}
    </div>
  );
};





const RegistroForm = () => {
  const [registroExitoso, setRegistroExitoso] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    
    // Lógica de registro exitoso (puede ser una llamada a una API, etc.)
    
    // Después de un registro exitoso, muestra el mensaje
    setRegistroExitoso(true);
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        {/* Campos del formulario */}
        {/* ... */}

        <button type="submit">Registrar</button>
      </form>

      {registroExitoso && <SuccessMessage message="¡Registro exitoso!" />}
    </div>
  );
};

export default RegistroForm;
